import React from "react";

function Input() {
    return (
        <div className="container">
            <h1>Hello</h1>
            <form className="form">
                <input type="text" placeholder="Username"></input>
                <input type="text" placeholder="Password"/>
                <button type="submit">Login</button>
            </form>
        </div>
    )
}
export default Input;
